import React, { Component } from 'react';

class Todo extends Component {
    constructor(props) {
        super(props);
        this.state = {
            values: {id: 1, value: "hello"}
        };
    }


    render() {
        let item;
        for (const [id, value] of this.state.values) {
            item.push(<li key={id}>value</li>)
        }

        return(
            <div class="row">
                <div class="s12 center">
                    <h4 class="card-panel teal lighten-2 center">Todo Application</h4>
                </div>
                <div class="container">
                    <ul class="collection">
                        {item}
                    </ul>
                </div>
                <div  class="container input-field">
                    <input type="text"></input>
                </div>
            </div>
        )
    }
}

export default Todo;
